package com.res.bean;public class ResOrderMenu implements java.io.Serializable {	private static final long serialVersionUID = 1L;		private Integer pkId;	private Integer orderNo;	private Integer itemId;	private String itemNo;	private String omMoney;	private Integer omNum;	private String omTotal;	private Integer omCreatetime;			public Integer getPkId() {		return pkId;	}	public void setPkId(Integer pkId) {		this.pkId = pkId;	}	public Integer getOrderNo() {		return orderNo;	}	public void setOrderNo(Integer orderNo) {		this.orderNo = orderNo;	}	public Integer getItemId() {		return itemId;	}	public void setItemId(Integer itemId) {		this.itemId = itemId;	}	public String getItemNo() {		return itemNo;	}	public void setItemNo(String itemNo) {		this.itemNo = itemNo;	}	public String getOmMoney() {		return omMoney;	}	public void setOmMoney(String omMoney) {		this.omMoney = omMoney;	}	public Integer getOmNum() {		return omNum;	}	public void setOmNum(Integer omNum) {		this.omNum = omNum;	}	public String getOmTotal() {		return omTotal;	}	public void setOmTotal(String omTotal) {		this.omTotal = omTotal;	}	public Integer getOmCreatetime() {		return omCreatetime;	}	public void setOmCreatetime(Integer omCreatetime) {		this.omCreatetime = omCreatetime;	}}